import * as React from 'react'; 
import { View, Image, ImageBackground, StyleSheet, Text, TextInput, Alert, ScrollView} from 'react-native';
import { Dimensions, StatusBar } from 'react-native';
import { RectButton } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';
import { TabView, SceneMap } from 'react-native-tab-view';

const GruposRoute = () => (
  <View style={[styles.scene, { backgroundColor: 'red' }]} />
);
const JogadoresRoute = () => (
  <View style={[styles.scene, { backgroundColor: 'blue' }]} />
);


export default function ResultadoPesquisa() {

  const navigation = useNavigation();
  const [index, setIndex] = React.useState(0);

  function handleNavigationToPerfil() {
    navigation.navigate('Perfil');
  }

  state = {
    index: 0,
    routes: [
      { key: 'Grupos', title: 'Grupos' },
      { key: 'Jogadores', title: 'Jogadores' },
    ],
  };

  return (
    <View style={styles.container}>

      <ImageBackground source={require('../../assets/images/fundo-login.png')}
        style={styles.imgFundo}>
        <View style={styles.topoPesquisa}>
          <View>
          <View style={styles.viewPesquisar}>

          <TextInput 
              style={styles.input} 
              autoCapitalize="characters" 
              autoCorrect={false} 
          /> 
          <RectButton style={styles.buttonInput} > 
                <Image style={styles.imgLupa} source={require('../../assets/images/lupa.png')} />
            </RectButton>
          </View>
          </View>
        </View>
        <View style={styles.bodyPesquisa}>
          <TabView
          navigationState={this.state}
          renderScene={SceneMap({
            Grupos: GruposRoute,
            Jogadores: JogadoresRoute,
          })}
          onIndexChange={index => setIndex(index)}
          initialLayout={{ width: Dimensions.get('window').width }}
          style={styles.map}
          renderTabBar={props => <TabBar style={{backgroundColor: 'black'}}/>}
          />

        <View style={styles.menu}>
            <RectButton style={styles.btnMenu}>
              <Image style={styles.imgMenu} source={require('../../assets/images/home-ativo.png')} />
            </RectButton>
            <RectButton style={styles.btnMenu}>
              <Image style={styles.imgMenu} source={require('../../assets/images/chat.png')} />
            </RectButton>
            <RectButton style={styles.btnMenu}>
              <Image style={styles.imgMenu} source={require('../../assets/images/notificacao.png')} />
            </RectButton>
            <RectButton style={styles.btnMenu} onPress={handleNavigationToPerfil}>
              <Image style={styles.imgMenu} source={require('../../assets/images/perfil.png')} />
            </RectButton>
          </View>
        </View>
      </ImageBackground>

    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },


  input: { 
    width:300,
    height: 40, 
    backgroundColor: '#FFF', 
    border: '1px solid black',
    borderRadius: 10, 
    paddingHorizontal: 15, 
    fontSize: 16, 
  }, 

  button: {
    width: 120,
    height: 45,
    backgroundColor: '#7EDD2A',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    borderRadius: 10,
    marginBottom: 8,
    marginTop: 8,
    paddingHorizontal: 24,
    fontSize: 16,
  },

  buttonText: {
    fontWeight: 'bold',
    fontSize: 17,
    color: '#FFF'
  },

  buttonTextBlack:{
    fontWeight: 'bold',
    fontSize: 17,
    color: '#474747'
  },

  imgFundo:{
    flex: 1,
    width: '100%',
    justifyContent: 'space-between',
    alignItems: 'center',
    backgroundColor: '#3956FF',
    borderBottomLeftRadius: 50,
    borderBottomRightRadius: 50,
  },

  titulo: {
    color: '#FFF',
    fontSize: 25,
    fontWeight: 'bold'
  },

  topoPesquisa: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'space-around',
    marginTop: 30
  },

  txtTitulo: {
    color: '#474747',
    fontSize: 20,
    fontWeight: 'bold',
    marginTop: 5
  },

  bodyPesquisa: {
    backgroundColor: '#FFF',
    width: '100%',
    height: 660,
    borderTopEndRadius: 40,
    borderTopStartRadius: 40,
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'space-between'
  },

  menu: {
    display: 'flex',
    justifyContent: 'space-around',
    height: 69,
    backgroundColor: '#FFF',
    width: '100%',
    flexDirection: 'row',
    alignItems: 'center',
    borderTopLeftRadius: 30,
    borderTopRightRadius: 30,
    shadowColor: "#000000",
    shadowOffset: {
      width: -20,
      height: -18,
    },
    shadowOpacity: 0.25,
    shadowRadius: 20.00,
    elevation: 24
  },

  btnMenu: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center'
  },

  selectJogo:{
    width:'90%',
    marginTop:20
  },

  SelecionarJogo:{
    width:'90%',
    alignItems:'center'
  },

  texttopoPesquisa:{
    color:'#FFF',
