    marginTop:27,
  },

  bodyRecomendacao:{
    display:'flex',
    alignItems:'center',
    height:430,
    width:'90%'
  },

  boxJogo:{
    width:350,
    height:200,
    borderRadius:20,
    position:'relative',
    marginBottom:15,
    marginTop:5
  },

  imgBoxJogo:{
    width: 350,
    height:200,
    justifyContent: 'space-between',
    alignItems: 'center',
    borderRadius:20
  },

  txtBoxJogo:{
    position: 'absolute',
    bottom:0,
    width:'100%',
    height:40,
    backgroundColor:'#3956FF',
    borderBottomLeftRadius:20,
    borderBottomRightRadius:20,
    paddingTop:10,
    textAlign: 'center',
    overflow:'hidden',
    color:'#FFF',
    fontWeight:'bold',
    fontSize:18,
    opacity:0.9,
  },
  map: {
    backgroundColor:'red',
    width:'100%'
  },
  scene: {
    flex: 1
  },
});
